def gcd(a, b):
    while b:
        r = a // b
        a, b = b, r
    return a

def xgcd(a, b):
    s0, s1 = 1, 0
    t0, t1 = 0, 1
    while b:
        q, r = a // b, a % b
        s = s0 - q * s1
        t = t0 - q * t1
        a, b = b, r
        s0, s1 = s1, s
        t0, t1 = t1, t
    return (a, s0, t0)

def phi(n):
    totient = 0
    for k in range(1, n + 1):
        if gcd(k, n) == 1:
            totient += 1
    return totient

